              maxKey = numKey;
            }
          }
        }
        
        const parsedData = [['mah', ...titles]];
        for (let i = minKey; i <= maxKey; i++) {
          parsedData.push([
            (i!= 0 ? i * 100 : 0), 
            ...titles.map(title => (data[title] && data[title][i] ? +(+data[title][i] / 1000).toFixed(1) : null))
          ]);
        }

        const options = {
          curveType: 'function',
          interpolateNulls: true,
          legend: { position: 'bottom' }
        };

        const chart = new google.visualization.LineChart(document.getElementById('chart'));
        const draw = () => chart.draw(google.visualization.arrayToDataTable(parsedData), options);

        draw();
        window.addEventListener('resize', draw);
      });
    </script>
  </head>
  <body>
    <div id="chart-wrapper">
      <div id="chart"></div>
    </div>
  </body>
</html>
